	add("health", "{\"term\":\"health\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 from Old english (ca. 450-1100) {{m|ang|h«£l√æ}}, ultimately from West Proto-germanic {{m|gem-pro|*haili√æ≈ç}}, from Proto-germanic {{m|gem-pro|*hailaz||whole, hale}}. Cognate with Old High German \u0027heilida\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being free from physical or psychological disease, illness, or malfunction; wellness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dThen he commenced to talk, really talk. and inside of two flaps of a herring\u0027s fin he had me mesmerized, like Eben Holt\u0027s boy at the town hall show. He talked about the ills of humanity, and the glories of \u0027\u0027health\u0027\u0027 and Nature and service and land knows what all\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A state of well-being or balance, often physical but sometimes also mental and social; the overall level of function of an organism from the cellular (micro) level to the social (macro) level\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Physical condition\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Cure, remedy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bk.XVII, Ch.XI\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And she myght have a dysshfulle of bloode of a maydyn and a clene virgyne in wylle and in worke, and a kynges doughter, that bloode sholde be her \u0027\u0027helth\u0027\u0027, for to anoynte her withall\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A toast to prosperity\", \"priority\":8}]}, \"synonyms\":{}}");

	add("heaps", "{\"term\":\"heaps\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large amount\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Lesley Brown (translator), Plato (author), \u0027Sophist\u0027, w:Stephanus page 245e\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And \u0027\u0027heaps\u0027\u0027 of objections, all of them involving countless difficulties, are going to face anyone who says either that being is some two things or that it is only one\", \"priority\":3}]}, \"synonyms\":{}}");

