	add("hearsomeness", "{\"term\":\"hearsomeness\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027hersumnesse\u0027 from Old english (ca. 450-1100) {{m|ang|hƒ´ersumnes||obedience, submission, service, humility}}, equivalent to {{suffix|hearsome|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Obedience; submission to authority\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1939\u0027\u0027, James Joyce, \u0027Finnegans Wake\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thus the \u0027\u0027hearsomeness\u0027\u0027 of the burger felicitates the whole of the polis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, John Bishop, \u0027Joyce\u0027s Book of the Dark\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"his awakened \u0026quot;\u0027\u0027hearsomeness\u0027\u0027\u0026quot; causing him to misconstrue the sound, along Aristotelean lines, as the sound of thunder\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Christine Froula, \u0027Modernism\u0027s body\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The cultural \u0026quot;bonum\u0026quot; that arrives by her Grace, issuing from the \u0026quot;malo\u0026quot; (apple/evil) of this \u0026quot;foenix culprit,\u0026quot; consists in her streaming urine/words, which the Jarl\u0027s felicitous \u0026quot;\u0027\u0027hearsomeness\u0027\u0027\u0026quot; ‚Äî his passion to keep her within his hearing and heir-ing\", \"priority\":7}]}, \"synonyms\":{}}");

	add("heartbeat", "{\"term\":\"heartbeat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|heart|beat|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One pulsation of the heart; especially an irregular one, hence the emotion which causes it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The policeman waited for a \u0027\u0027heartbeat\u0027\u0027 in vain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He alone gives me such \u0027\u0027heartbeats\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The rhythm at which a heart pulsates, a cardiac indicato\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If your \u0027\u0027heartbeat\u0027\u0027 doesn\u0027t normalize soon, consult a doctor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A driving impulse or vital force\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Music is the \u0027\u0027heartbeat\u0027\u0027 of the people\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A very short space of time; an instant\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The ambulance arrived in a \u0027\u0027heartbeat\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A periodic signal generated by hardware or software to indicate normal operation or to synchronize other parts of a system\", \"priority\":10}]}, \"synonyms\":{}}");

