	add("heartbreaker", "{\"term\":\"heartbreaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027heartbreak\u0027 + \u0027-er\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone, usually attractive, who flirts with or otherwise enamours a person, but does not reciprocate their love\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Alison Pace, \u0027If Andy Warhol Had a Girlfriend\u0027, Penguin (ISBN 9781440684616\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It wasn\u0026amp\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"39;t an actual run-in with the \u0027\u0027heartbreaker\u0027\u0027 himself, but with a very good friend of his. It\u0026amp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"39;s actually much better that way, Victor explained, because seeing the friend of the person who stepped on your heart isn\u0026amp\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"39;t going to kill you all over again\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Lynn Price, \u0027Donovan\u0027s Paradigm\u0027, Behler Publications (ISBN 9781933016573), page 23\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;And this little lovely standing next to him is my favorite \u0027\u0027heartbreaker\u0027\u0027, The Fair Lady Sara from Samaria. Kids, this is Dr. Donovan.\u0026quot; Sara beamed, obviously thrilled at being considered anyone\u0026amp\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"39;s \u0027\u0027heartbreaker\u0027\u0027, especially Uncle Erik\u0026amp\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Andrea J Buchanan, \u0027It\u0027s a Boy: Women Writers on Raising Sons\u0027, Seal Press (ISBN 9780786746323), page 14\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I imagined him as the kind of boy who knows girls are equals; the teen with female friends as well as male; then a kind man, a good man, the kind of man who knows better than to be a \u0027\u0027heartbreaker\u0027\u0027, despite his looks\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Something that causes sorrow, grief or extreme disappointment\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, James Ellroy, \u0027White Jazz\u0027, Vintage (ISBN 9780307798428), page 34\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"He\u0026amp\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"39;s not lucid most of the time, and that\u0026amp\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"39;s a \u0027\u0027heartbreaker\u0027\u0027. The LAPD will not release details on the altercation that earned Dudley Smith his wounds; they know he would prefer to spare the family of the robber he killed the ignominy of public\u0026amp;nbsp\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, George Saunders, \u0027The Braindead Megaphone\u0027, Penguin (ISBN 9781101217474\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"It\u0026amp\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"39;s a \u0027\u0027heartbreaker\u0027\u0027, as I was reminded just now when I went to get the chapter reference, reread it, and started bawling\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Bobbi Sheahan, Kathy DeOrnellas, \u0027What I Wish I\u0027d Known about Raising a Child with Autism: A Mom and a Psychologist Offer Heartfelt Guidance for the First Five Years\u0027, Future Horizons (ISBN 9781935274230), page 19\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"It\u0026amp\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"39;s a \u0027\u0027heartbreaker\u0027\u0027. The worst part of that situation was trying to console Grace. It was just awful. Don\u0026amp\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"39;t let experiences like this make you bitter. The truth is, our kids are a challenge, and not everyone is going to want to join us in this journey\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A match which ends in defeat for a promising player or team\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Mark Stallard, \u0027Tales from the Jayhawks Gridiron\u0027, Sports Publishing LLC (ISBN 9781582617916), page 16\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Kansas appeared in its first bowl following the 1947 season, losing a \u0027\u0027heartbreaker\u0027\u0027 to Georgia Tech in the Orange Bowl. KU landed in the Bluebonnet Bowl following the 1961 season, and beat up a good Rice squad, 33-7\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Tom Benjey, \u0027Keep A-goin\u0027: The Life of Lone Star Dietz\u0027, Tuxedo Press (ISBN 9780977448609), page 24\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Wyoming lost a \u0027\u0027heartbreaker\u0027\u0027 7‚Äì6. Utah\u0026amp\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"39;s touchdown was scored on an intercepted pass, Wyoming missed an extra point and, most importantly, an official did not get downfield in time to see a punt hit a Utah player not once, but twic\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Dieter Dubberke, \u0027Three Times Blessed\u0027, Xlibris Corporation (ISBN 9781462817849), page 9\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"In 1988 and again in 1989 the team went back to Bristol, Connecticut, for the nationals, coming in at third place one year and in second place another, losing the championship to Wisconsin-Oshkosh in a \u0027\u0027heartbreaker\u0027\u0027 in eleven innings\", \"priority\":31}]}, \"synonyms\":{}}");

