	add("hearth", "{\"term\":\"hearth\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027herth\u0027 from Old english (ca. 450-1100) \u0027heor√æ\u0027 from Proto-germanic {{m|gem-pro|*her√æaz}}, from Proto-indo-european {{m|ine-pro|*ker-||heat; fire}}. Cognate with West Frisian \u0027hurd\u0027 Dutch \u0027haard\u0027 German \u0027herd\u0027 Swedish \u0027h√§rd\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brick, stone or cement floor to a fireplace or oven\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"When the flames at last began to flicker and subside, his lids fluttered, then drooped‚Äâ; but he had lost all reckoning of time when he opened them again to find Miss Erroll in furs kneeling on the \u0027\u0027hearth\u0027\u0027 and heaping kindling on the coals, and her pretty little Alsatian maid beside her, laying a log across the andirons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An open recess in a wall at the base of a chimney where a fire may be built\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The lowest part of a metallurgical furnace\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A symbol for home or family life\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A household or group following the modern pagan faith of Heathenry\", \"priority\":6}]}, \"synonyms\":{}}");

