	add("heath", "{\"term\":\"heath\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Latin\", \"Dutch\", \"old welsh\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027heeth\u0027 \u0027hethe\u0027 \u0027heth\u0027 from Old english (ca. 450-1100) {{m|ang|h«£√æ||heath, untilled land, waste; heather}}, from Proto-germanic {{m|gem-pro|*hai√æƒ´||heath, waste, untilled land}}, from Proto-indo-european {{m|ine-pro|*kait-||forest, wasteland, pasture}}. Cognate with Dutch \u0027heide\u0027 (heath, moorland) German \u0027heide\u0027 (heath, moor) Swedish \u0027hed\u0027 (heath, moorland) Old welsh \u0027coit\u0027 (forest) Latin \u0027bucetum\u0027 {{m|la|-etum||place of, grove of}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tract of level uncultivated land with sandy soil and scrubby vegetation; heathland\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1602\u0027\u0027, William Shakespeare, \u0027Macbeth\u0027, Act I, scene I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1. Where the place?/2. Vpon the \u0027\u0027Heath\u0027\u0027/3. There to meet with Macbet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any small evergreen shrub of the family \u0027Ericaceae\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, \u0027The Book of Ebenezer Le Page\u0027, New York 2007, p. 258\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"There was nobody living in Jim\u0027s old house, and some of the windows was broken; but there was \u0027\u0027heath\u0027\u0027 growing back and front\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Many of the species in the genus \u0027Erica\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Many of the species in the genus \u0027Cassiope\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Both species in the genus\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any of the species in the genus\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Any of the species in the genus\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Any of the species in the genus\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Certain butterflies and moth\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The palaearctic species of \u0027Coenonympha\u0027, a genus of brush-footed butterfl\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"native to Europe, Asia except tropical India and Indochina, and Northern Africa, the small heat\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"native to Europe, Asia except tropical India and Indochina, and North America, the large heat\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"the heath fritillar\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"a moth known as the\", \"priority\":18}]}, \"synonyms\":{}}");

	add("heathendom", "{\"term\":\"heathendom\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|h√¶thendom}}, from Old english (ca. 450-1100) {{m|ang|h«£√æend≈çm}}, from Proto-germanic {{m|gem-pro|*hai√æinad≈çmaz}}, equivalent to {{suffix|heathen|dom|lang\u003den}}. OED¬†records a single attestation in the period between 1230 and 1840, a (nonce?) occurrence in J. Law, \u0027Proposals and reasons for constituting a council of trade in Scotland\u0027 (1701, p. 233). Otherwise replaced by heathenism in the 17th and 18th centuries.Cognate with Dutch {{m|nl|heidendom}}, Old High German {{m|goh|heidentuom}} (German {{m|de|Heidentum}}), Old Norse {{m|non|hei√∞ind√≥mr}} (Swedish {{m|sv|hedendom}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being heathen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The priest argued to the king that unless clerics accompanied the colony ship, the colony would soon descend into \u0027\u0027heathendom\u0027\u0027 and barbarity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"From one religion\u0027s or creed\u0027s perspective, the rest of the world that does not follow that creed or religion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"My aunt considered all of Europe to be \u0027\u0027heathendom\u0027\u0027, and refused to visit us in Amsterdam on religious grounds\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the non-Christian world; territories where Christianity is not the dominant religion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Crusaders meant to wrest Jerusalem from \u0027\u0027heathendom\u0027\u0027, but they managed to pillage a number of lands in Christendom along the way\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The worldwide community that follows Heathenry, a modern pagan faith inspired by the pre-Abrahamic religions of Germanic tribes, Anglo-Saxons and Norse peoples\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Urs App, \u0027The Birth of Orientalism\u0027, Page 10\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Ziegenbalg mentioned some major forms of heathendom (African, American, old European\", \"priority\":9}]}, \"synonyms\":{}}");

	add("heather", "{\"term\":\"heather\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An evergreen plant, with spiky leaves and small purple, pink, or white flowers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Ericaceae family\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Various species of the genus \u0027Erica\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Various species of the genus \u0027Cassiope\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A purple colour with a tint of pink and blue\", \"priority\":5}]}, \"synonyms\":{}}");

	add("heather", "{\"term\":\"heather\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027heather\u0027 the given name is one of the plant names taken up in the 19th century. The surname is habitational, also meaning someone living on a heath.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1867\u0027\u0027 J.H.Riddell: \u0027Far Above Rubies\u0027. Bernhard Tauchnitz 1867. page 50\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She struck his fancy - that pretty girl with the quaint name: sweet \u0027\u0027Heather\u0027\u0027 Bell, as Mr. Travers always called her\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;The name was a fancy of her godfather, an eccentric bachelor,\u0026quot; the lady explained. \u0026quot; She was the youngest of three daughters, and the other two were called, respectively, \u0027Lily\u0027 and \u0027Rose\u0027. \u0027Call this one \u0027\u0027Heather\u0027\u0027,\u0027 said Mr. Stewart, who loved Scotland and her purple mountains, \u0027she will grow up like the heather, perhaps - strong, hardy, a wild flower, worth of a hundred of your garden rarities\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027 John Irving: \u0027The Cider House Rules\u0027. Ballantine Books 2001. ISBN 0345417941 page 506\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;I like Hazel and \u0027\u0027Heather\u0027\u0027,\u0026quot; Angel said, after a while. \u0026quot;They\u0027re both names of plants, so they sort of go with Rose.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;I don\u0027t have no plant, I got a little girl,\u0026quot; Rose Rose said, smiling\", \"priority\":6}]}, \"synonyms\":{}}");

	add("heating", "{\"term\":\"heating\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|heat|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A system that raises the temperature of a room or building. Compare heater\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of making something hot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The crucible was subjected to several \u0027\u0027heatings\", \"priority\":3}]}, \"synonyms\":{}}");

	add("heatlessness", "{\"term\":\"heatlessness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|heatless|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being heatless; absence of heat\", \"priority\":1}]}, \"synonyms\":{}}");

	add("heatshield", "{\"term\":\"heatshield\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|heat|shield|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A system designed to protect what is behind it against heat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An ablative system designed to protect an object entering an atmosphere at high speed from the resulting very high temperature\", \"priority\":2}]}, \"synonyms\":{}}");

